import styled from 'styled-components';
import Header from '../components/header';

export default () => (
  <div>
    <Header />
    <div className="banner">
      <div className="profile_image">
      </div>
    </div>
    <style jsx>{`
      .banner {
        height: 50%;
      }
      .profile_image {
        height: 1000px;
        width: 500px;
        background: url("../static/traci.jpg");
      }
    `}</style>
  </div>
);
